import React, { Component } from 'react';

import { ApolloClient, InMemoryCache } from '@apollo/client';
import { ApolloProvider } from '@apollo/client/react'; //similar to React's Context.Provider
//It wraps our React app and places the client on the context, which enables you to access it from anywhere in your component tree.

import './App.css';
import logo from './spacex_logo.png';

const client = new ApolloClient({
  uri: 'http://localhost:5000/graphql',
  cache: new InMemoryCache()
});

class App extends Component {
  render() {
    return (
      <div className="App">
      <img 
        src={logo} 
        alt="SpaceX"
        style={{ width:300, display: 'block', margin: 'auto'}}
      />
      {/* <h1>SpaceX</h1> */}
      </div>
    );
  }
}

export default App;
